import "./index.css";
import Home from "./components/SignIn";
import UserData from './components/UserData'
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Register from "./components/userRegister/Register";
import RegisterdUserData from "./components/userRegister/RegisterdUserData";
import Profile from "./components/Profile";
import ProtectedRoute from "./ProtectedRoute";
import { useState } from "react";

function App() {
  const [isLoggedIn, setisLoggedIn] = useState(null);
  const logIn = () => {
    setisLoggedIn(true);
  };
  const logOut = () => {
    setisLoggedIn(false);
  };
  return (
    <div className="App">


      <BrowserRouter>
        <Routes>
          <Route index element={<Home />}></Route>
          <Route path="/userdata" element={<UserData />}/>
          <Route path="/register" element={<Register />}/>
          <Route path="/registerdUser" element={<RegisterdUserData />}/>
          <Route path="/profile" element={<ProtectedRoute path = "/profile" component={Profile}  auth={false}/>} /> 
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
